import React, { useState , useEffect } from "react";

function LoginPage() {
  const [cnt,setCnt]=useState(0);
  useEffect(()=> {document.title = "Come Back!!!"}
  )
  return (
    <div>
      <p>Count : {cnt} </p>
      <button className="btn" onClick={()=>setCnt(cnt+1)}>
        Click ME 
      </button>      
      <button className="btn" onClick={()=>setCnt(0)}>
        Reset
      </button>
      <button className="btn" onClick={()=>setCnt(cnt-1)} disabled={cnt===0}>
        Decrement 
      </button>
    </div>
  );
}

export default LoginPage;
